    "2015-09-01T18:26:57.655554",nt"name": "urban-influence-codes",nt"isopen":
    true,nt"url": null,nt"notes": "The 2013 Urban Influence Codes form a classification
    scheme that distinguishes metropolitan counties by population size of their metro
    area, and nonmetropolitan counties by size of the largest city or town and proximity
    to metro and micropolitan areas. The standard Office of Management and Budget (OMB)
    metro and nonmetro categories have been subdivided into two metro and 10 nonmetro
    categories, resulting in a 12-part county classification. This scheme was originally
    developed in 1993. This scheme allows researchers to break county data into finer
    residential groups, beyond metro and nonmetro, particularly for the analysis of
    trends in nonmetro areas that are related to population density and metro influence.
    rn rnAn update of the Urban Influence Codes is planned for mid-2023.",nt"license_title":
